import React from "react";
import About from "./components/About";
import BlogGallery from "./components/BlogGallery";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header>
        <h1>My Nutrition Blog</h1>
      </header>
      <main>
        <About />
        <BlogGallery />
      </main>
    </div>
  );
}

export default App;
